import { createTheme } from '@mui/material/styles';

const theme = createTheme({
    palette: {
        primary: {
            main: '#003971',
        },
        secondary: {
            main: '#f44336',
        },
    },
    typography: {
        fontFamily: 'DIN',
    },
    components: {
        MuiContainer: {
            styleOverrides: {
                root: {
                    maxWidth: '1024px', // set max width to 1200px
                },
            },
        },
    },
});

export default theme;
